import { Injectable } from '@angular/core';
import { takeUntil } from 'rxjs';
import { HttpClient, HttpHeaders } from '@angular/common/http';

@Injectable({
  providedIn: 'root',
})
export class BackendService {
  private baseUrl = 'http://localhost:3000';
  httpOptions = {
    headers: new HttpHeaders({ 'Content-Type': 'application/json' }),
  };

  constructor(private httpClient: HttpClient) {}

  // return list of all the students registered
  getStudents() {
    return this.httpClient.get(this.baseUrl + '/getUsers');
  }

  async authenticateAdmin(u: string, p: string) {
    let correctUser = false;
    await this.httpClient
      .post(this.baseUrl + '/login', { u: u, p: p }, this.httpOptions)
      .subscribe((r) => {
        console.log('in authentiacate subscritber');
        correctUser = true;
      });
    return correctUser;
  }
}
